'use strict';
if (!('ontouchstart' in document.documentElement) && document.getElementById("private-basket") === null){

	if (window.sessionStorage && window.sessionStorage.autocomplete){
		_autocomplete(JSON.parse(window.sessionStorage.autocomplete));
	}
	else {
		// Load countries then initialize plugin:
		$.ajax({
			url: '/cgi-bin/product_ajax.cgi?autocomplete=load',
			dataType: 'json'
		}).done(function (source) {
			if (window.sessionStorage) window.sessionStorage.autocomplete = JSON.stringify(source);
			_autocomplete(source);
		});
	}
	
	function _autocomplete(source){
	
		var countriesArray = $.map(source, function (value, key) { return { value: value, data: key }; });
			
		$('input#word_search').autocomplete({
			lookup: countriesArray,
			onSelect: function (suggestion) {
				var params = new Object();
				var article = suggestion.data.replace(/(.+?)\[(.+?)\]/g, '$1');
				params.get_autocomplete_alias = article;
				$.post('/cgi-bin/product_ajax.cgi', params, function(alias){
					if (alias != "") {
						location.replace("/products/"+ article +"/"+alias);			
					}
				});
			}
		});		
	}
}
